import './App.css';

function App() {
  return (
    <container className="App">
      <div className="header">
        <nav className="navbar">
          <ul className="navlist">
            <li className="navlist-items active"><a href="#home" >Home</a></li>
            <li className="navlist-items"><a href="#doc">Doc</a></li>
            <li className="navlist-items"><a href="#faq">FAQ</a></li>
            <li className="navlist-items"><a href="#contact">Contact</a></li>
          </ul>
        </nav>
      </div>

    </container>
  );
}

export default App;
